import Datadb from '../Data/NewsDb.json'
function TestCops() {
    Datadb.map(data=>{
        return(
            <div key={data.id}>
                <p>{data.description}</p>
                <img src={data.image} alt='imagerter' />
            </div>
        )
    })
  }

  export default TestCops;
